import React from 'react';
import "./Team.css";

const PointsCard = ({ rank, teamName, logo, points, played, won, nrr, recentForm }) => {
  return (
    <div className="card">
      <div className="card-rank">{rank}</div>
      <div className="team-logo-wrap">
        <h3>{teamName}</h3>
        <img src={logo} alt={teamName} />
      </div>
      <div className="card-info">
        <div><strong>{points}</strong> <span>Points</span></div>
        <div><strong>{played}</strong> <span>Played</span></div>
        <div><strong>{won}</strong> <span>Won</span></div>
        <div><strong className="nrr">{nrr}</strong> <span>NRR</span></div>
      </div>
      <div className="card-form">
        <p>Recent form</p>
        <div className="form-circles">
          {recentForm.map((f, i) => (
            <span key={i} className={`form ${f}`}>{f}</span>
          ))}
        </div>
      </div>
    </div>
  );
};

export default PointsCard;
